import photo from './photo.png';
import React from 'react';

export default function Image() {
    var image = <img className="mr-8 border-4 rounded-full border-black dark:border-white" src={photo} height="140" width="140"></img>;

    return (
        <div>
            {image}
        </div>
    );
}
